        return new Source("{% extends 'base.html.twig' %}

{% block title %}Paciente index{% endblock %}

{% block body %}
    <h1>Paciente index</h1>

       <div class=\"container\">
        <div class=\"row\">
            <div  class=\"col-lg-9\"></div>
            <div class=\"col-lg-3\">
             <a href=\"{{ path('paciente_new') }}\">Agregar Paciente</a>
            </div>
        </div>
     </div>

    <table class=\"table table-striped table-bordered table-condensed\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Nombre_paciente</th>
                <th>Direccion</th>
                <th>Fecha_nac</th>
                <th>Telefono</th>
                <th>Acciones</th>
            </tr>
        </thead>
        <tbody>
        {% for paciente in pacientes %}
            <tr>
                <td>{{ paciente.id }}</td>
                <td>{{ paciente.nombrePaciente }}</td>
                <td>{{ paciente.direccion }}</td>
                <td>{{ paciente.fechaNac ? paciente.fechaNac|date('Y-m-d') : '' }}</td>
                <td>{{ paciente.telefono }}</td>
                <td>
                    <a href=\"{{ path('paciente_show', {'id': paciente.id}) }}\">Mostrar</a>
                    <a href=\"{{ path('paciente_edit', {'id': paciente.id}) }}\">Editar</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"6\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

{% endblock %}
